import React from "react"
import { Button } from './Button';
import { Meta } from '@storybook/react';

const meta: Meta = {
    title: 'Example/Button',
    component: Button,
    args: {
        primary: true,
        label: 'ボタン',
        size: 'small'
    },
};

export type TButton = {
    primary: boolean | undefined,
    label: string | undefined,
    size: string | undefined,
    backgroundColor: string | undefined
}

export const button = (args: TButton) => <Button {...args} />;;

export const primary = button.bind({});
button.args = {
    primary: true,
    label: 'Button',
    size: 'small'
};


export default meta;


button.parameters = { storySource: { source: "(args: TButton) => <Button {...args} />" }, ...button.parameters };
primary.parameters = { storySource: { source: "(args: TButton) => <Button {...args} />" }, ...primary.parameters };
